import React from "react";

const LoginForm = () => {
  return (
    <section className="">
      <div
        className="px-4 py-5 px-md-5 text-center text-lg-start"
        style={{ backgroundColor: "#f5f5f5" }}
      >
        <div className="container">
            <div></div>
        </div>
      </div>
    </section>
  );
};

export default LoginForm;
